# In[ ]:

rds = aws.rds

def parameter_group_iteritems(group_name):

    first_page = True
    get_next_page = True
    
    while get_next_page:
        if first_page:
            pg = rds.get_all_dbparameters(group_name)
            first_page = False
        else:
            pg = rds.get_all_dbparameters(group_name, marker = pg.Marker)
            
        for key in pg.keys():
            yield (key, pg[key])
    
        get_next_page = hasattr(pg, 'Marker')


